import React from 'react';
import Navbar from './NavbarHome';
import '../css/App.css';
import Fader from './Fader';

const Home = ({ user }) => {
    return (
        <div className="home">
            <Navbar user={user}/>
            <div style={{height: "40vw", position: "relative"}}>
                <div style={{position: "absolute", top: "50%", left: "50%", transform: "translate(-50%, -50%)", transform: "translate(-50%, -50%)"}}>
                    <Fader text="Welcome to our survey" interval="500"/>
                    <Fader text="on" interval="1000"/>
                    <Fader text="human reasoning" interval="1500"/>
                </div> 
            </div>          
        </div>
    )
}

export default Home;
